package parser

import (
	"encoding/base64"
	"intel/isecl/sqvs/v5/resource/domain/models"
	"reflect"
	"testing"

	"github.com/stretchr/testify/assert"
)

func TestParseQuoteBlob(t *testing.T) {
	// valid raw blob given
	rawBlob := ""
	got := ParseQuoteBlob(rawBlob)
	assert.NotEmpty(t, got, nil)

	newParser := NewSGXQuoteParser([]byte(rawBlob))
	assert.NotNil(t, newParser)

	newParser = NewSGXQuoteParser(nil)
	assert.Nil(t, newParser)

	// invalid encoded string given
	rawBlob = "testValue"
	got = ParseQuoteBlob(rawBlob)
	assert.Empty(t, got, nil)
	// assert.Equal(t, nil, got)

	// invalid length of quote string given
	rawBlob = ""
	got = ParseQuoteBlob(rawBlob)
	assert.Empty(t, got, nil)
}

func TestSkcBlobParsedGetQuoteBlob(t *testing.T) {
	e := &SkcBlobParsed{
		QuoteBlob: []byte("testByte"),
	}
	if got := e.GetQuoteBlob(); !reflect.DeepEqual(got, []byte("testByte")) {
		t.Errorf("SkcBlobParsed.GetQuoteBlob() = %v, want %v", got, []byte("testByte"))
	}
}

func TestParseEcdsaQuoteBlob(t *testing.T) {
	// valid raw blob given
	rawBlob := ""
	decodedBlob, _ := base64.StdEncoding.DecodeString(rawBlob)
	got := ParseEcdsaQuoteBlob(decodedBlob)
	assert.NotNil(t, got)

	got = ParseEcdsaQuoteBlob([]byte("invalidTestData"))
	assert.Nil(t, got)
}

func TestSgxQuoteParser(t *testing.T) {

	// valid raw blob given
	rawBlob := ""
	decodedBlob, _ := base64.StdEncoding.DecodeString(rawBlob)
	parsedObj := ParseEcdsaQuoteBlob(decodedBlob)
	assert.NotNil(t, parsedObj)

	got := parsedObj.GetSHA256Hash()
	assert.NotNil(t, got)

	// valid data
	got, err := parsedObj.GetQeReportBlob()
	assert.Nil(t, err)
	assert.NotNil(t, got)

	// Valid tests for common functions.
	got, err = parsedObj.GetHeaderAndEnclaveReportBlob()
	assert.Nil(t, err)

	qeAttribute := parsedObj.GetQeReportAttributes()
	assert.NotNil(t, qeAttribute)

	misc := parsedObj.GetQeReportMiscSelect()
	assert.NotNil(t, misc)

	mrsigner := parsedObj.GetQeReportMrSigner()
	assert.NotNil(t, mrsigner)

	enMrsigner := parsedObj.GetEnclaveMrSigner()
	assert.NotNil(t, enMrsigner)

	qeReportProdID := parsedObj.GetQeReportProdID()
	assert.NotNil(t, qeReportProdID)

	enReportProdID := parsedObj.GetEnclaveReportProdID()
	assert.NotNil(t, enReportProdID)

	qeReportIsvSvn := parsedObj.GetQeReportIsvSvn()
	assert.NotNil(t, qeReportIsvSvn)

	enReportIsvSvn := parsedObj.GetEnclaveReportIsvSvn()
	assert.NotNil(t, enReportIsvSvn)

	qeReportMrEnclave := parsedObj.GetQeReportMrEnclave()
	assert.NotNil(t, qeReportMrEnclave)

	enReportMrEnclave := parsedObj.GetEnclaveReportMrEnclave()
	assert.NotNil(t, enReportMrEnclave)

	parsedObj.DumpSGXQuote()

	signature := parsedObj.GetEnclaveReportSignature()
	assert.NotNil(t, signature)

	qeReportSignature := parsedObj.GetQeReportSignature()
	assert.NotNil(t, qeReportSignature)

	attestationPublicKey := parsedObj.GetAttestationPublicKey()
	assert.NotNil(t, attestationPublicKey)

	quotePckCertObj := parsedObj.GetQuotePckCertObj()
	assert.NotNil(t, quotePckCertObj)

	pckCertInterCAList := parsedObj.GetQuotePckCertInterCAList()
	assert.NotNil(t, pckCertInterCAList)

	quotePckCertRootCAList := parsedObj.GetQuotePckCertRootCAList()
	assert.NotNil(t, quotePckCertRootCAList)

	parseQuoteCerts := parsedObj.ParseQuoteCerts()
	assert.Nil(t, parseQuoteCerts)
	err = parsedObj.ParseRawECDSAQuote(decodedBlob)
	assert.Nil(t, err)

	// with empty data
	parsedObj.QuoteSignatureData = models.QuoteAuthData{}
	got, err = parsedObj.GetQeReportBlob()
	assert.Nil(t, err)
	assert.NotNil(t, got)
}
